import { PARAMETERS } from "./interfaces"

const  parameters:PARAMETERS = {
    baseUrl:String(process.env.REACT_APP_BASE_URL),
    endpoints: {
        schedule_full:"/schedule/full",
        shows:"/shows"
    }
}

export default parameters
